%[text] ## Step 2 - カテゴリの空間配置
% clear; clc; close all;
%%
%[text] ### 1. Step 1の結果読み込み
try %[output:group:75db4a09]
    load('step1_results.mat', 'analysisData');
    fprintf('Step 1の結果を読み込みました\n'); %[output:1f60f583]
catch
    error('step1_results.matが見つかりません。Step 1を先に実行してください。');
end %[output:group:75db4a09]

salesMatrix = analysisData.salesMatrix;
uniqueCategories = analysisData.uniqueCategories;
nCategories = length(uniqueCategories);

fprintf('カテゴリ数: %d\n', nCategories); %[output:51bb9703]

% データ型を確認して適切なアクセス方法を決定
isCell = iscell(uniqueCategories);
%%
%[text] ### 2. データの前処理と正規化
normalizedMatrix = salesMatrix ./ max(salesMatrix, [], 2);
normalizedMatrix(isnan(normalizedMatrix)) = 0;
%%
%[text] ### 3. 主成分分析（PCA）による2次元配置
[coeff, score, latent, ~, explained] = pca(normalizedMatrix);
coords2D = score(:, 1:2);

fprintf('PCA完了\n'); %[output:549c9a2e]
fprintf('第1主成分の寄与率: %.1f%%\n', explained(1)); %[output:5d073bda]
fprintf('第2主成分の寄与率: %.1f%%\n', explained(2)); %[output:29eb125b]
fprintf('累積寄与率: %.1f%%\n', sum(explained(1:2))); %[output:42e5b4c2]
%%
%[text] ### 4. 相関に基づく距離行列の作成
% カテゴリ間の相関行列を計算
corrMatrix = corrcoef(salesMatrix');
distanceMatrix = (1 - corrMatrix) / 2;
distanceMatrix(1:nCategories+1:end) = 0;

% 相関係数の高いペアを抽出（対角成分と下三角を除外）
upperTriangle = triu(corrMatrix, 1);  % 上三角行列（対角成分を除く）
[corrValues, sortIdx] = sort(upperTriangle(:), 'descend');

% 0でない相関値のみを対象とする
validIdx = corrValues ~= 0;
corrValues = corrValues(validIdx);
sortIdx = sortIdx(validIdx);

% 上位ペアの数を決定（レイアウト判断に十分な数を確保）
nTopPairs = min(20, length(corrValues));  % top20まで、または有効な相関数が20未満ならその数まで

% 行列インデックスから行・列番号を取得
[rowIdx, colIdx] = ind2sub(size(corrMatrix), sortIdx(1:nTopPairs));

% 高相関ペアの情報を保存（データ型に応じた処理）
topPairs = struct();
for i = 1:nTopPairs
    if isCell
        topPairs(i).category1 = uniqueCategories{rowIdx(i)};
        topPairs(i).category2 = uniqueCategories{colIdx(i)};
    else
        topPairs(i).category1 = char(uniqueCategories(rowIdx(i)));
        topPairs(i).category2 = char(uniqueCategories(colIdx(i)));
    end
    topPairs(i).correlation = corrValues(i);
    topPairs(i).idx1 = rowIdx(i);
    topPairs(i).idx2 = colIdx(i);
end

% 高相関ペアの表示
fprintf('\n■ カテゴリ間相関の上位%dペア:\n', nTopPairs); %[output:53e29793]
fprintf('順位 | カテゴリ1              | カテゴリ2              | 相関係数\n'); %[output:76446702]
fprintf('--------------------------------------------------------------------\n'); %[output:89a98c9e]
for i = 1:min(10, nTopPairs)  % 最初の10ペアを表示 %[output:group:36f539dc]
    fprintf('%2d位 | %-20s | %-20s | %6.3f\n', ... %[output:99e35ef8]
        i, topPairs(i).category1, topPairs(i).category2, topPairs(i).correlation); %[output:99e35ef8]
end %[output:group:36f539dc]

% 日記手帳と趣味の相関を確認
if isCell
    nikki_idx = find(strcmp(uniqueCategories, '日記手帳'));
    shumi_idx = find(strcmp(uniqueCategories, '趣味'));
else
    nikki_idx = find(uniqueCategories == "日記手帳");
    shumi_idx = find(uniqueCategories == "趣味");
end

if ~isempty(nikki_idx) && ~isempty(shumi_idx) %[output:group:5e51ee25]
    nikki_shumi_corr = corrMatrix(nikki_idx, shumi_idx);
    fprintf('\n※ 日記手帳と趣味の相関係数: %.3f\n', nikki_shumi_corr); %[output:989341bd]
    
    % この相関が上位何位かを確認
    rank = find(corrValues >= nikki_shumi_corr, 1, 'last');
    if ~isempty(rank)
        fprintf('   → 全ペア中 第%d位\n', rank); %[output:369e8253]
    end
end %[output:group:5e51ee25]
%%
%[text] ### 5. 階層クラスタリングによるゾーン分け
distanceVector = squareform(distanceMatrix);
linkageMatrix = linkage(distanceVector, 'ward'); %[output:6c8d4dbf]

if nCategories < 10
    nClusters = 3;
elseif nCategories < 20
    nClusters = 4;
else
    nClusters = 5;
end

clusterIdx = cluster(linkageMatrix, 'MaxClust', nClusters);

for i = 1:nClusters %[output:group:1e48171a]
    fprintf('ゾーン%d: %d カテゴリ\n', i, sum(clusterIdx == i)); %[output:1e8c5f2b]
end %[output:group:1e48171a]
%%
%[text] ### 6. レイアウトマップの可視化
figure('Name', '書店カテゴリレイアウトマップ（修正版）', 'Position', [50 50 1500 800]); %[output:9456ff77]

% サブプロット1: PCAによる2次元配置
subplot(1, 2, 1); %[output:9456ff77]
hold on; %[output:9456ff77]

colors = lines(nClusters);
markerSize = 150;

for i = 1:nClusters
    idx = find(clusterIdx == i);
    if ~isempty(idx)
        scatter(coords2D(idx, 1), coords2D(idx, 2), ... %[output:9456ff77]
            markerSize, colors(i, :), 'filled', ... %[output:9456ff77]
            'MarkerEdgeColor', 'k', 'LineWidth', 1); %[output:9456ff77]
    end
end

% カテゴリ名をラベル表示（データ型に応じた処理）
for i = 1:nCategories
    if isCell
        catName = uniqueCategories{i};
    else
        catName = char(uniqueCategories(i));
    end
    if length(catName) > 6
        catName = [catName(1:5) '..'];
    end
    text(coords2D(i, 1), coords2D(i, 2), catName, ... %[output:9456ff77]
        'HorizontalAlignment', 'center', 'FontSize', 8, 'FontWeight', 'bold'); %[output:9456ff77]
end

xlabel('第1主成分（配置X軸）'); %[output:9456ff77]
ylabel('第2主成分（配置Y軸）'); %[output:9456ff77]
title(sprintf('カテゴリの空間配置（PCA: 累積寄与率%.1f%%）', sum(explained(1:2)))); %[output:9456ff77]
grid on; %[output:9456ff77]
axis equal; %[output:9456ff77]

legendStr = arrayfun(@(i) sprintf('ゾーン%d (%d個)', i, sum(clusterIdx == i)), ...
    1:nClusters, 'UniformOutput', false);
legend(legendStr, 'Location', 'best'); %[output:9456ff77]

% サブプロット2: 高相関カテゴリのヒートマップ
subplot(1, 2, 2); %[output:9456ff77]

% 高相関ペアに関連するカテゴリのインデックスを取得
relatedCatIdx = unique([rowIdx(1:nTopPairs); colIdx(1:nTopPairs)]);
nRelatedCats = length(relatedCatIdx);

% 関連カテゴリ間の相関行列を抽出
relatedCorrMatrix = corrMatrix(relatedCatIdx, relatedCatIdx);

% ヒートマップ表示
imagesc(relatedCorrMatrix); %[output:9456ff77]
colorbar; %[output:9456ff77]
colormap(jet); %[output:9456ff77]
caxis([0 1]);  % 正の相関のみ表示（0-1の範囲） %[output:9456ff77]

xlabel('カテゴリ'); %[output:9456ff77]
ylabel('カテゴリ'); %[output:9456ff77]
title(sprintf('高相関カテゴリのヒートマップ（上位%dペアに関連）', nTopPairs)); %[output:9456ff77]

% カテゴリ名を軸ラベルに（データ型に応じた処理）
catLabels = cell(nRelatedCats, 1);
for i = 1:nRelatedCats
    if isCell
        catName = uniqueCategories{relatedCatIdx(i)};
    else
        catName = char(uniqueCategories(relatedCatIdx(i)));
    end
    if length(catName) > 8
        catLabels{i} = [catName(1:7) '..'];
    else
        catLabels{i} = catName;
    end
end

set(gca, 'XTick', 1:nRelatedCats, 'XTickLabel', catLabels, 'XTickLabelRotation', 45); %[output:9456ff77]
set(gca, 'YTick', 1:nRelatedCats, 'YTickLabel', catLabels); %[output:9456ff77]
axis square; %[output:9456ff77]
%%
%[text] ### 7. レイアウト提案の生成
figure('Name', 'カテゴリ相関ネットワーク', 'Position', [100 100 900 800]); %[output:0c864142]
hold on; %[output:0c864142]

% 高相関のペアを線で結ぶ(閾値を設定)
corrThreshold = 0.5; % 相関係数0.5以上のみ表示

for i = 1:nCategories
    for j = i+1:nCategories
        if corrMatrix(i, j) >= corrThreshold
            % 線の太さを相関の強さに応じて調整
            lineWidth = 1 + 3 * (corrMatrix(i, j) - corrThreshold) / (1 - corrThreshold);
            
            % 線の色も相関の強さで変化(赤から青へ)
            colorIntensity = (corrMatrix(i, j) - corrThreshold) / (1 - corrThreshold);
            lineColor = [1-colorIntensity, 0, colorIntensity];
            
            % 線をプロット(ハンドルを取得)
            h = plot([coords2D(i, 1), coords2D(j, 1)], ... %[output:0c864142]
                     [coords2D(i, 2), coords2D(j, 2)], ... %[output:0c864142]
                     'LineWidth', lineWidth); %[output:0c864142]
            
            % 透明度を設定(RGBに4番目の要素としてアルファ値を追加)
            h.Color = [lineColor, 0.5];
        end
    end
end

  for i = 1:nClusters
      idx = find(clusterIdx == i);
      if length(idx) >= 3
          k = convhull(coords2D(idx, 1), coords2D(idx, 2));
          patch(coords2D(idx(k), 1), coords2D(idx(k), 2), ... %[output:0c864142]
                colors(i, :), 'FaceAlpha', 0.1, 'EdgeColor', colors(i, :), ... %[output:0c864142]
                'LineWidth', 1.5, 'LineStyle', '--'); %[output:0c864142]
      end
  end

% カテゴリのプロット
for i = 1:nClusters
    idx = find(clusterIdx == i);
    if ~isempty(idx)
        scatter(coords2D(idx, 1), coords2D(idx, 2), ... %[output:0c864142]
            200, colors(i, :), 'filled', ... %[output:0c864142]
            'MarkerEdgeColor', 'k', 'LineWidth', 2); %[output:0c864142]
    end
end


% カテゴリ名を表示（データ型に応じた処理）
for i = 1:nCategories
    if isCell
        catName = uniqueCategories{i};
    else
        catName = char(uniqueCategories(i));
    end
    text(coords2D(i, 1), coords2D(i, 2), catName, ... %[output:0c864142]
        'HorizontalAlignment', 'center', 'FontSize', 9, ... %[output:0c864142]
        'FontWeight', 'bold', 'BackgroundColor', 'white', ... %[output:0c864142]
        'EdgeColor', 'none'); %[output:0c864142]
end

xlabel('第1主成分'); %[output:0c864142]
ylabel('第2主成分'); %[output:0c864142]
title(sprintf('カテゴリ相関ネットワーク（相関係数 >= %.1f）', corrThreshold)); %[output:0c864142]
grid on; %[output:0c864142]
axis equal; %[output:0c864142]
%%
%[text] ### 8. ゾーンごとの特徴分析
totalSales = sum(salesMatrix, 2);
centerDist = sqrt(coords2D(:,1).^2 + coords2D(:,2).^2);

% スコア計算（販売数と中心からの距離、相関の強さを考慮）
salesScore = totalSales / max(totalSales);
centerScore = 1 - (centerDist / max(centerDist));

% 各カテゴリの平均相関係数を計算（他カテゴリとの関連性の指標）
meanCorr = mean(abs(corrMatrix - eye(nCategories)), 2);
corrScore = meanCorr / max(meanCorr);

% 総合スコア（重み付け）
finalScore = 0.5 * salesScore + 0.2 * centerScore + 0.3 * corrScore;

[~, priorityOrder] = sort(finalScore, 'descend');

fprintf('\n■ 推奨配置（総合スコア順）:\n'); %[output:24ec4fc9]
fprintf('順位 | カテゴリ名               | ゾーン | 販売数   | 平均相関 | スコア\n'); %[output:502a2c77]
fprintf('------------------------------------------------------------------------\n'); %[output:5a2e543a]

for i = 1:min(15, length(priorityOrder)) %[output:group:767528a5]
    catIdx = priorityOrder(i);
    if isCell
        catName = uniqueCategories{catIdx};
    else
        catName = char(uniqueCategories(catIdx));
    end
    fprintf('%2d位 | %-20s | Zone%d | %8d | %.3f    | %.3f\n', ... %[output:584973ad]
        i, catName, clusterIdx(catIdx), ... %[output:584973ad]
        round(totalSales(catIdx)), meanCorr(catIdx), finalScore(catIdx)); %[output:584973ad]
end %[output:group:767528a5]
%%
%[text] ### 9. 動線シミュレーション図の作成
fprintf('\n■ ゾーン別特徴分析:\n'); %[output:27a9eab9]
zoneCharacteristics = struct();

for z = 1:nClusters %[output:group:833b91e2]
    zoneCategories = find(clusterIdx == z);
    if isempty(zoneCategories)
        continue;
    end
    
    zoneSales = salesMatrix(zoneCategories, :);
    totalZoneSales = sum(zoneSales(:));
    avgZoneSales = mean(zoneSales(:));
    
    % ゾーン内の相関の強さ
    zoneCorr = corrMatrix(zoneCategories, zoneCategories);
    avgZoneCorr = mean(zoneCorr(zoneCorr ~= 1));  % 対角成分を除く
    
    centerX = mean(coords2D(zoneCategories, 1));
    centerY = mean(coords2D(zoneCategories, 2));
    
    fprintf('\n【ゾーン %d】\n', z); %[output:910fba22] %[output:47a41ea7] %[output:90896d18] %[output:5e11580f] %[output:360db63e]
    fprintf('  構成: %d カテゴリ\n', length(zoneCategories)); %[output:5f5b2307] %[output:0fe13924] %[output:5be3bdcc] %[output:4d172325] %[output:4f5ac230]
    fprintf('  総販売: %d 冊\n', round(totalZoneSales)); %[output:6030d486] %[output:17421da1] %[output:386af60f] %[output:01450f97] %[output:9f8da59f]
    fprintf('  平均販売: %.1f 冊/日\n', avgZoneSales); %[output:883fccdd] %[output:073c4cdc] %[output:5d3278b4] %[output:2cd09f09] %[output:055fa283]
    fprintf('  ゾーン内平均相関: %.3f\n', avgZoneCorr); %[output:59e52426] %[output:557a2338] %[output:0ac12276] %[output:01a09e31] %[output:9bb44b88]
    fprintf('  配置重心: (%.2f, %.2f)\n', centerX, centerY); %[output:9f46188c] %[output:06c3be53] %[output:54853e36] %[output:77047590] %[output:791cf135]
    
    zoneTotalSales = sum(zoneSales, 2);
    [maxSales, maxIdx] = max(zoneTotalSales);
    if isCell
        repCatName = uniqueCategories{zoneCategories(maxIdx)};
    else
        repCatName = char(uniqueCategories(zoneCategories(maxIdx)));
    end
    fprintf('  代表カテゴリ: %s (販売数:%d)\n', repCatName, round(maxSales)); %[output:0f88dc62] %[output:0520af09] %[output:00934c1a] %[output:7dcb5b24] %[output:98a925e1]
    
    % ゾーン内のカテゴリ一覧
    fprintf('  カテゴリ一覧: '); %[output:82f4830a] %[output:874240df] %[output:701e7c92] %[output:664cbf9f] %[output:7e9956a9]
    for k = 1:length(zoneCategories)
        if isCell
            catName = uniqueCategories{zoneCategories(k)};
        else
            catName = char(uniqueCategories(zoneCategories(k)));
        end
        fprintf('%s', catName); %[output:3f1534fc] %[output:35bc4f39] %[output:7f5bef14] %[output:5c18f14c] %[output:06cc7723] %[output:6ea54995] %[output:693d3d47] %[output:9e8df068] %[output:091cbafa] %[output:916ddcf1] %[output:194a430d] %[output:0ae4d399] %[output:6d756fb6] %[output:100d5079] %[output:4fbf821c] %[output:71cd52a6] %[output:45e0d517] %[output:2b5efcc5] %[output:2e799f7b] %[output:866b7747] %[output:9441aaa8] %[output:6324a837] %[output:09990179] %[output:9ce5cb6d] %[output:40409abb] %[output:5b5a45ec] %[output:357b8ee0] %[output:3c70276e] %[output:9b6e49c9] %[output:98e7dd91] %[output:5ce9cca4] %[output:372a0ede] %[output:77a545b5] %[output:3cb0369b]
        if k < length(zoneCategories)
            fprintf(', '); %[output:4dacccd4] %[output:31ae15ac] %[output:3033e815] %[output:23e920d6] %[output:3b4083bc] %[output:7b362740] %[output:31f37e0d] %[output:30f87c08] %[output:6cab1a74] %[output:2e5f0a68] %[output:1542eef8] %[output:2ced539d] %[output:79868f29] %[output:0dfcbd61] %[output:3d71d4c1] %[output:184dff1e] %[output:507186da] %[output:6f04dab4] %[output:77918a18] %[output:4532a7d8] %[output:4eaf8b03] %[output:345b033c] %[output:540622ad] %[output:7b86084b] %[output:7ef33555] %[output:1d5e1938] %[output:366f7ffb] %[output:858bfd5c] %[output:50809214]
        end
    end
    fprintf('\n');
    
    zoneCharacteristics(z).categories = zoneCategories;
    zoneCharacteristics(z).totalSales = totalZoneSales;
    zoneCharacteristics(z).avgCorrelation = avgZoneCorr;
    zoneCharacteristics(z).center = [centerX, centerY];
end %[output:group:833b91e2]
%%
%[text] ### 10. 結果の保存
figure('Name', '推奨動線レイアウト', 'Position', [100 100 900 800]); %[output:1f443a69]
hold on; %[output:1f443a69]

% ゾーン領域を描画
theta = linspace(0, 2*pi, 100);
for z = 1:nClusters
    zoneCategories = find(clusterIdx == z);
    if isempty(zoneCategories)
        continue;
    end
    
    centerX = mean(coords2D(zoneCategories, 1));
    centerY = mean(coords2D(zoneCategories, 2));
    
    if length(zoneCategories) > 1
        radius = max(sqrt((coords2D(zoneCategories, 1) - centerX).^2 + ...
                         (coords2D(zoneCategories, 2) - centerY).^2)) * 1.2;
    else
        radius = 0.5;
    end
    
    fill(centerX + radius*cos(theta), centerY + radius*sin(theta), ... %[output:1f443a69]
         colors(z, :), 'FaceAlpha', 0.3, 'EdgeColor', 'none'); %[output:1f443a69]
end

% カテゴリをプロット
for i = 1:nClusters
    idx = find(clusterIdx == i);
    if ~isempty(idx)
        scatter(coords2D(idx, 1), coords2D(idx, 2), ... %[output:1f443a69]
            100, colors(i, :), 'filled', 'MarkerEdgeColor', 'k', 'LineWidth', 1); %[output:1f443a69]
    end
end

% カテゴリ名を表示（データ型に応じた処理）
for i = 1:nCategories
    if isCell
        catName = uniqueCategories{i};
    else
        catName = char(uniqueCategories(i));
    end
    if length(catName) > 6
        catName = [catName(1:5) '..'];
    end
    text(coords2D(i, 1), coords2D(i, 2), catName, ... %[output:1f443a69]
        'HorizontalAlignment', 'center', 'FontSize', 7, 'FontWeight', 'bold'); %[output:1f443a69]
end

% 推奨動線を矢印で描画（上位カテゴリ間）
for i = 1:min(5, length(priorityOrder)-1)
    fromIdx = priorityOrder(i);
    toIdx = priorityOrder(i+1);
    
    quiver(coords2D(fromIdx, 1), coords2D(fromIdx, 2), ... %[output:1f443a69]
           coords2D(toIdx, 1) - coords2D(fromIdx, 1), ... %[output:1f443a69]
           coords2D(toIdx, 2) - coords2D(fromIdx, 2), ... %[output:1f443a69]
           0, 'k', 'LineWidth', 2, 'MaxHeadSize', 0.5); %[output:1f443a69]
end

% 入口マーク
text(coords2D(priorityOrder(1), 1), coords2D(priorityOrder(1), 2) - 0.5, ... %[output:1f443a69]
     '★入口', 'FontSize', 14, 'FontWeight', 'bold', ... %[output:1f443a69]
     'HorizontalAlignment', 'center', 'Color', 'r'); %[output:1f443a69]

xlabel('レイアウトX軸'); %[output:1f443a69]
ylabel('レイアウトY軸'); %[output:1f443a69]
title('推奨店舗レイアウトと動線'); %[output:1f443a69]
grid on; %[output:1f443a69]
axis equal; %[output:1f443a69]
%%
%[text] ### 11. 結果の保存
step2Results.coords2D = coords2D;
step2Results.clusterIdx = clusterIdx;
step2Results.distanceMatrix = distanceMatrix;
step2Results.corrMatrix = corrMatrix;
step2Results.topPairs = topPairs;
step2Results.finalScore = finalScore;
step2Results.priorityOrder = priorityOrder;
step2Results.explained = explained;
step2Results.zoneCharacteristics = zoneCharacteristics;

save('step2_results.mat', 'step2Results', 'analysisData');
fprintf('\n結果を step2_results.mat に保存しました\n'); %[output:5498ce80]

